import React, { useState } from "react";
import { Link } from 'react-router-dom';

export function EditProfile({ profile, setProfile, mbtiOption }) {
    const [formData, setFormData] = useState(profile);
    const [showMbtiForm, setShowMbtiForm] = useState(false);
    const [mbtiData, setMbtiData] = useState(profile.mbtiData || {
        EI: '',
        SN: '',
        TF: '',
        JP: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleMbtiChange = (e) => {
        const { name, value } = e.target;
        setMbtiData({
            ...mbtiData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        setProfile({...formData, mbtiData: mbtiData});
    };

    const handleMbtiSubmit = () => {
        setFormData({...formData, mbtiData: mbtiData});
        setShowMbtiForm(false);
    };

    return (
        <main>
            <section className="profile-container">
                <img onClick={() => setShowMbtiForm(!showMbtiForm)} className="editpercent" src="./img/editmbti.png" alt="Edit MBTI" />
                <div className="profile-pic">edit picture</div>
                <div className="profile-info">
                    <form onSubmit={handleSubmit}>
                        <label htmlFor="name">Name:</label><br />
                        <input type="text" id="name" name="name" value={formData.name} onChange={handleChange} /><br />
                        <label>Pronouns:</label><br />
                        <input type="text" id="pronouns" name="pronouns" value={formData.pronouns} onChange={handleChange} /><br /><br />
                        <label htmlFor="types">MBTI:</label><br />
                        <select id="types" name="mbti" value={formData.mbti} onChange={handleChange}>
                            <option value="starter">Edit MBTI</option>
                            {mbtiOption.map((option) => (
                                <option key={option.value} value={option.value}>{option.label}</option>
                            ))}
                        </select>
                        <input type="text" placeholder="Edit Pet Peeve" className="edit" id="petpeeve" name="petpeeve" value={formData.petpeeve} onChange={handleChange}></input>
                        <input type="text" placeholder="Edit Hobby" className="edit" id="hobby" name="hobby" value={formData.hobby} onChange={handleChange}></input>
                        <input type="text" placeholder="Edit Favorite Song" className="edit" id="favsong" name="favsong" value={formData.favsong} onChange={handleChange}></input>
                        <Link to="/profile">
                            <input type="submit" value="Submit" />
                        </Link>
                    </form>
                </div>
                {showMbtiForm && (
                    <div className="mbti-form-user">
                        <label htmlFor="EI">E/I Percentage:</label>
                        <input type="number" id="EI" name="EI" value={mbtiData.EI} onChange={handleMbtiChange} />
                        <label htmlFor="SN">S/N Percentage:</label>
                        <input type="number" id="SN" name="SN" value={mbtiData.SN} onChange={handleMbtiChange} />
                        <label htmlFor="TF">T/F Percentage:</label>
                        <input type="number" id="TF" name="TF" value={mbtiData.TF} onChange={handleMbtiChange} />
                        <label htmlFor="JP">J/P Percentage:</label>
                        <input type="number" id="JP" name="JP" value={mbtiData.JP} onChange={handleMbtiChange} />
                        <button type="button" className="submit-button" onClick={handleMbtiSubmit}>Save MBTI</button>
                    </div>
                )}
            </section>
        </main>
    );
}
